import{_ as e,o as i,c as o,g as r,f as a}from"./app.74e3ecb9.js";var l="/geo-6-dzial/lejek.jpg",z="/geo-6-dzial/podziemne.jpeg",t="/geo-6-dzial/v-ksztalt.jpg",n="/geo-6-dzial/erozja-boczna.jpg",s="/geo-6-dzial/delta.jpeg",c="/geo-6-dzial/estuarium.jpg",p="/geo-6-dzial/lodowiec.png",w="/geo-6-dzial/baraniec.jpg",d="/geo-6-dzial/u-ksztalt.jpg",y="/geo-6-dzial/polodowcowy.png",k="/geo-6-dzial/klif.jpg",g="/geo-6-dzial/mierzeja.png",u="/geo-6-dzial/fiord.png",m="/geo-6-dzial/szkier.png",j="/geo-6-dzial/dalmatynskie.png",_="/geo-6-dzial/rias.png",b="/geo-6-dzial/mierzej.jpg",h="/geo-6-dzial/namorzyn.jpg",f="/geo-6-dzial/bruk.jpg",v="/geo-6-dzial/grzyb.jpg",x="/geo-6-dzial/barchan.png",P="/geo-6-dzial/paraboliczna.png",W="/geo-6-dzial/gwiazda.jpg";const B='{"title":"Dzia\u0142 VI - Litosfera. Procesy zewn\u0119trzne","description":"Notatka dotycz\u0105ca VI rozdzia\u0142u podr\u0119cznika \\"Oblicza geografii 1\\" wydawnictwa Nowej Ery.","frontmatter":{"title":"Dzia\u0142 VI - Litosfera. Procesy zewn\u0119trzne","description":"Notatka dotycz\u0105ca VI rozdzia\u0142u podr\u0119cznika \\"Oblicza geografii 1\\" wydawnictwa Nowej Ery."},"headers":[{"level":2,"title":"Wietrzenie. Procesy krasowe","slug":"wietrzenie-procesy-krasowe"},{"level":2,"title":"Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 rzek","slug":"rzezbotworcza-dzialalnosc-rzek"},{"level":2,"title":"Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 lodowc\xF3w g\xF3rskich i l\u0105dolod\xF3w","slug":"rzezbotworcza-dzialalnosc-lodowcow-gorskich-i-ladolodow"},{"level":3,"title":"Dzia\u0142alno\u015B\u0107 lodowc\xF3w g\xF3rskich","slug":"dzialalnosc-lodowcow-gorskich"},{"level":3,"title":"Dzia\u0142alno\u015B\u0107 l\u0105dolod\xF3w","slug":"dzialalnosc-ladolodow"},{"level":2,"title":"Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 morza","slug":"rzezbotworcza-dzialalnosc-morza"},{"level":2,"title":"Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 wiatru","slug":"rzezbotworcza-dzialalnosc-wiatru"}],"relativePath":"pages/Polski/Szkola/Geografia/6-dzial.md","lastUpdated":1709057980554}',N={},R=a('<h1 id="dzial-vi-litosfera-procesy-zewnetrzne">Dzia\u0142 VI - Litosfera. Procesy zewn\u0119trzne</h1><h2 id="wietrzenie-procesy-krasowe">Wietrzenie. Procesy krasowe</h2><p>Wietrzenie to proces niszczenia ska\u0142 pod wp\u0142ywem energii s\u0142onecznej, zmiennej temperatury powietrza oraz dzia\u0142alno\u015Bci wody i organizm\xF3w. Wyr\xF3\u017Cniamy trzy g\u0142\xF3wne typy wietrzenia:</p><ul><li>wietrzenie fizyczne - kruszenie ska\u0142. Przyk\u0142ady: <ul><li>wietrzenie mrozowe - woda wype\u0142nia szczeliny, zamarza i rozsadza ska\u0142y.</li><li>wietrzenie termiczne - w dzie\u0144 tempertatura jest bardzo wysoka (nagrzane ska\u0142y zwi\u0119kszaj\u0105 swoj\u0105 obj\u0119to\u015B\u0107), w nocy natomiast niska (ska\u0142y si\u0119 kurcz\u0105). Z powodu zmian obj\u0119to\u015Bci ska\u0142, zmniejsza si\u0119 ich spoisto\u015B\u0107, zaczynaj\u0105 p\u0119ka\u0107 i odpadaj\u0105 od nich ma\u0142e - nazywa si\u0119 to \u0142uszczeniem ska\u0142.</li></ul></li><li>wietrzenie chemiczne - rozpuszczanie ska\u0142. Np. woda &quot;topi&quot; ska\u0142y wapienne - proces ten nazywamy krasowieniem, podczas kt\xF3rego powstaj\u0105 formy krasowe.</li><li>wietrzenie biologiczne - wietrzenie spowodowane ingerencj\u0105 zwierz\u0105t i ro\u015Blin. Np. zwierz\u0119ta biegaj\u0105ce po skale krusz\u0105 j\u0105 albo korzenie ro\u015Blin powi\u0119kszaj\u0105 szczeliny.</li></ul><p>W wyniku wietrzenia powstaj\u0105 zwietrzeliny (takie kamyczki albo inny piasek).</p><p>Jeszcze tak na marginesie, to istniej\u0105 dwa rodzaje form krasowych:</p><ul><li>powierzchniowe formy krasowe</li></ul><p class="center"><img src="'+l+'" alt="alt text"> P O T \u0118 \u017B N Y lejek krasowy - jeden z form krasowych powierzchniowych</p><ul><li>podziemne formy krasowe</li></ul><p class="center"><img src="'+z+'" alt="alt text"> Trzy przyk\u0142adowe podziemne formy krasowe</p><h2 id="rzezbotworcza-dzialalnosc-rzek">Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 rzek</h2><p>Rze\u017Abiotw\xF3rcza dzia\u0142alno\u015B\u0107 rzeki to oddzia\u0142ywanie wody w rzece na pod\u0142o\u017Ce, po kt\xF3rym p\u0142ynie. R\xF3\u017Cne procesy zachodz\u0105 na r\xF3\u017Cnych odcinkach rzeki, a wyr\xF3\u017Cniamy ich 3:</p><ul><li>g\xF3rny odcinek rzeki. \u0179r\xF3d\u0142o najcz\u0119\u015Bciej znajduje si\u0119 w g\xF3rach, z tego powodu p\u0142ynie ona pocz\u0105tkowo z du\u017C\u0105 pr\u0119dko\u015Bci\u0105. Na tym odcinku zachodzi erozja (\u017C\u0142obienie pod\u0142o\u017Ca), w wyniku kt\xF3rego dochodzi do formowania doliny V-kszta\u0142tnej. Materia\u0142 skalny jest transportowany przez rzek\u0119, rozdrabniany i szlifowany (tak powstaj\u0105 otoczaki).</li></ul><p class="center"><img src="'+t+'" alt="alt text"> Dolina v-kszta\u0142tna - strome zbocza, w\u0105skie dno</p><ul><li>\u015Brodkowy odcinek rzeki. Zmniejsza si\u0119 pr\u0119dko\u015B\u0107, przez co maleje erozja wg\u0142\u0119bna. Natomiast dominuje erozja boczna - podcinanie brzeg\xF3w rzeki. Nurt wody przemieszcza si\u0119 z jednego brzegu na drugi i je podmywa. W wyniku erozji bocznej cz\u0119\u015B\u0107 materia\u0142u skalnego osadza si\u0119 w miejscach, gdzie woda p\u0142ynie najwolniej, powstaj\u0105 zakola rzeczne (meandry), a po przerwaniu maender, starorzecza.</li></ul><p class="center"><img src="'+n+'" alt="alt text"> Przebieg erozji bocznej</p><ul><li><p>dolny odcinek rzeki. Woda p\u0142ynie tu najwolniej, przez co tutaj najwi\u0119cej osadza si\u0119 materia\u0142 skalny (akumulacja). Najwi\u0119cej osadza si\u0119 przy uj\u015Bciu. S\u0105 dwa typy uj\u015B\u0107:</p><ul><li>uj\u015Bcie deltowe - powstaje, gdy morze jest p\u0142ytkie i spokojne.</li></ul></li></ul><p class="center"><img src="'+s+'" alt="alt text"> Delta Nilu</p>',18),T=a('<ul style="list-style:none;"><li><ul><li>uj\u015Bcie lejkowate - powstaje, gdzie wyst\u0119puj\u0105 znaczne przyp\u0142ywy a morze jest g\u0142\u0119bokie.</li></ul></li></ul><p class="center"><img src="'+c+'" alt="alt text"> Uj\u015Bcie lejkowate La Planta</p><h2 id="rzezbotworcza-dzialalnosc-lodowcow-gorskich-i-ladolodow">Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 lodowc\xF3w g\xF3rskich i l\u0105dolod\xF3w</h2><p>Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 lodowc\xF3w g\xF3rskich i l\u0105dolod\xF3w polega na tym samym co dzia\u0142alno\u015B\u0107 rzek - niszczeniu pod\u0142o\u017Ca, transporcie i osadzaniu materia\u0142u skalnego.</p><h3 id="dzialalnosc-lodowcow-gorskich">Dzia\u0142alno\u015B\u0107 lodowc\xF3w g\xF3rskich</h3><p>Ze zgromadzonego w g\xF3rach \u015Bniegu powstaje pole firnowe. W wyniku \u017C\u0142obienia powstaje pod nim kocio\u0142 lodowcowy. Jak jest za du\u017Co \u015Bniegu to jedzie on w d\xF3\u0142 tworz\u0105c j\u0119zor lodowcowy. Przenoszony materia\u0142 skalny formuje moreny.</p><p class="center"><img src="'+p+'" alt="alt text"> Lodowiec i te moreny</p><p>Na skutek dzia\u0142alno\u015Bci lodowc\xF3w g\xF3rskich powstaj\u0105:</p><ul><li>Bara\u0144ce (mutony)</li></ul><p class="center"><img src="'+w+'" alt="alt text"></p><ul><li>Doliny U-kszta\u0142tne (w wyniku przekszta\u0142cenia doliny V-kszta\u0142tnej)</li></ul><p class="center"><img src="'+d+'" alt="alt text"></p><h3 id="dzialalnosc-ladolodow">Dzia\u0142alno\u015B\u0107 l\u0105dolod\xF3w</h3><p>Pozosta\u0142o\u015Bci po dzia\u0142alno\u015Bci l\u0105dolod\xF3w to:</p><ul><li>rynny polodowcowe - w\u0105skie zag\u0142\u0119bienia, kt\xF3re cz\u0119sto wype\u0142nia woda.</li><li>pradoliny - szerokie doliny.</li><li>sandry - rozleg\u0142e r\xF3wniny ze \u017Cwir\xF3w i piask\xF3w.</li><li>ozy - d\u0142ugie w\u0105skie wa\u0142y zbudowane z piasku i \u017Cwiru.</li><li>obszary moreny dennej - tereny faliste.</li></ul><p class="center"><img src="'+y+'" alt="alt text"></p><h2 id="rzezbotworcza-dzialalnosc-morza">Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 morza</h2><p>Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 morza polega na niszczeniu i budowaniu wybrze\u017Cy.</p><p>Abrazja polega na niszczeniu brzeg\xF3w przez fale morskie.</p><p>Wysokie brzegi niszczone s\u0105 podczas sztorm\xF3w, gdy fale uderzaj\u0105 z du\u017C\u0105 si\u0142\u0105 i podcinaj\u0105 ich dolne cz\u0119\u015Bci. Tak powstaje nisza abrazyjna nad kt\xF3r\u0105 wisi nawis skalny. Z czasem nawis skalny si\u0119 obrywa i powstaje klif.</p><p class="center"><img src="'+k+'" alt="alt text"></p><p>Materia\u0142 skalny ze zniszczonych klif\xF3w osadza si\u0119 na brzegach, w taki spos\xF3b powstaje pla\u017Ca. Podobnie powstaj\u0105 mierzeje.</p><p class="center"><img src="'+g+'" alt="alt text"> Proces powstawania mierzei</p><p>Typy wybrze\u017Cy (nie chce mi si\u0119 wypisywa\u0107 charakterystycznych cech, po prostu dam obrazki):</p><ul><li>Wybrze\u017Ca fiordowe</li></ul><p class="center"><img src="'+u+'" alt="alt text"></p><ul><li>Wybrze\u017Ca szkierowe</li></ul><p class="center"><img src="'+m+'" alt="alt text"></p><ul><li>Wybrze\u017Ca dalmaty\u0144skie</li></ul><p class="center"><img src="'+j+'" alt="alt text"></p><ul><li>Wybrze\u017Ca riasowe</li></ul><p class="center"><img src="'+_+'" alt="alt text"></p><ul><li>Wybrze\u017Ca zalewowo-mierzejowe</li></ul><p class="center"><img src="'+b+'" alt="alt text"></p><ul><li>Wybrze\u017Ca namorzynowe</li></ul><p class="center"><img src="'+h+'" alt="alt text"></p><h2 id="rzezbotworcza-dzialalnosc-wiatru">Rze\u017Abotw\xF3rcza dzia\u0142alno\u015B\u0107 wiatru</h2><p>Rze\u017Abotworcza dzia\u0142alno\u015B\u0107 wiatru polega na niszeniu, transporcie i osadzaniu materia\u0142u skalnego.</p><p>Deflacja polega na wywiewaniu materia\u0142u skalnego z obszar\xF3w zbudowanych z lu\u017Anych ska\u0142. Wi\u0119ksze okruchy skalne tworz\u0105 bruk deflacyjny pokazany poni\u017Cej.</p><p class="center"><img src="'+f+'" alt="alt text"></p><p>Korazja polega na niszczeniu powierzchni skalnej przez uderzaj\u0105ce w ni\u0105 inne okruchy skalne. W jej wyniku powstaj\u0105 grzyby skalne pokazany poni\u017Cej.</p><p class="center"><img src="'+v+'" alt="alt text"></p><p>Niesiony materia\u0142 skalny osadza si\u0119 i tworzy wydmy, kt\xF3rych wyr\xF3\u017Cniamy trzy rodzaje:</p><ul><li>Barchany - pustynne obszary, zero ro\u015Blinno\u015Bci, wiatr wieje w jednym kierunku.</li></ul><p class="center"><img src="'+x+'" alt="alt text"></p><ul><li>Wydmy paraboliczne - troch\u0119 wilgotniejsze, sk\u0105pa ro\u015Blinno\u015B\u0107.</li></ul><p class="center"><img src="'+P+'" alt="alt text"></p><ul><li>Wydmy gwia\u017Adziste - kierunek wiatru cz\u0119sto si\u0119 zmienia</li></ul><p class="center"><img src="'+W+'" alt="alt text"></p><p>Rodzaje pusty\u0144:</p><ul><li>ilaste - na powierchni jest pop\u0119kany i\u0142.</li><li>piasczyste - na powierzchni jest piasek.</li><li>kamieniste, \u017Cwirowe - na powierzchni nagie ska\u0142y.</li></ul>',51);function D(V,I,S,A,C,E){return i(),o("div",null,[R,r(" had to do this "),T])}var Z=e(N,[["render",D]]);export{B as __pageData,Z as default};
